package Guvi_IP_OP;

import java.util.Scanner;

public class Guvi5_Ip_Op {

	/*
	 * Write a code to get the input in the given format and print the output in the
	 * given format
	 * 
	 * Input Description: Three integers are given in line by line.
	 * 
	 * Output Description: Print the integers in a single line separate by space.
	 * 
	 * Sample Input : 2 4 5 Sample Output : 2 4 5
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc = new Scanner(System.in);
		int A = sc.nextInt();
		int B = sc.nextInt();
		int C = sc.nextInt();
		System.out.print(A+" "+B+ " "+C);
		sc.close();
   }

}
